import React from "react";
import Home from "./Home"
import { Routes, Route } from "react-router-dom";



const App = () => {
  return (
    <>
    <Routes>
    <Route path="/" Component={Home}/>
    <Home />
    </Routes>
    </>
  );
}

export default App;
